ace the Marvel Cinematic Universe. We know that’s a bold statement, but what can we say? He’s a bold guy. Bold and incredible powerful, which is a truly dangerous combination. But that doesn’t mean he’s completely infallible, as we learned during Avengers: Endgame. There are some times when this dastardly villain actually got scared. We’re going to be talking about some comic book characters who could beat him in a battle, including the formidable cosmic entity Galactus. Of course, there are plenty of epic big screen moments as well including his confrontation with Thor’s weapon, Stormbreaker. But is terror the reason he never tried to steal one of the Infinity Stones from Odin’s vault? Not only did Tony Stark defeat him in battle but he even managed to inspire a little bit of fear in this mighty enemy. We think there’s a very real reason he spared the life of Iron Man during Infinity War, even if he later came to regret it. Did he really despite his daughter Nebula so much or was this character his own worst enemy more often than not? \n\nWhich one of these greatest fears is your favorite or is there one we missed? Take some time to share your thoughts with us in the comment section and then click on the subscribe button to get access to more great videos from us here at CBR. \n\nFeaturing:\n\nEntry 1 - ENDGAME\nEntry 2 - STORMBREAKER\nEntry 3 - SELF-DOUBT\nEntry 4 - OVERPOPULATION\nEntry 5 - SELF-REFLECTION\nEntry 6 - ALL-FATHER\nEntry 7 - SOUL\nEntry 8 - THE CAVE\nEntry 9 - WORTHINESS\nEntry 10 - GALACTUS\n\n------------------------------------------------------------------------------------------------------------\n\nOur Social Media:\n"},{"text":"https://twitter.com/CBR","navigationEndpoint":{"clickTrackingParams":"CNUBEM2rARgBIhMI1f-4mLjM7AIVD_hoCh3XigpmSLPfv5iX6MqCaA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=aAUrQXMP77M\u0026redir_token=QUFFLUhqbHhfMU1fTlBXaUJtU0N4a212bzY1QzVDWHNId3xBQ3Jtc0tuNGpqejVYd2dEa2x1Mz
